package main
import (
  "bytes"
  "compress/gzip"
  "encoding/base64"
  "io"
  "github.com/computeportal/glui"
)
const (
  dog_data =""
)
var dog = &glui.ImageData{nil, 900, 638}
func load_dog() bool {
  b, err := base64.StdEncoding.DecodeString(dog_data)
  if err != nil {panic(err)}
  r, err := gzip.NewReader(bytes.NewBuffer(b))
  if err != nil {panic(err)}
  c := &bytes.Buffer{}
  io.Copy(c, r)
  dog.Pix = c.Bytes()
  return true
}
var dog_loaded = load_dog()